(window.webpackJsonp=window.webpackJsonp||[]).push([[44],{267:function(e){e.exports={data:{session:{speaker:"Anna Heiermann",bio:"Anna has 10 years of testing experience where she has led QA teams on projects within Higher Education, Nutrition, Energy and Aviation Industries. Outside of the testing and consulting world, you can find Anna either with her family or her favorite gym crew training for her next power lifting personal best. Anna enjoys living the country life on a couple acres with her husband and her full of mischief Boston Terrier, Chloe.",title:"You Can't Always Get What You Want, but If You Try Sometimes...",abstract:"Do you ever feel like you are asked to test something and the pieces you need aren't there? You can't always get what you want, but if you try sometimes you get what you need, or maybe some of what you need. Come listen, and get some tips as I talk about how I've been able to make a successful case in order to get the right test data, resources, environments and instances where I've had to be creative with testing when I didn't get what I asked for.",time:"1:55 - 2:55",room:"Cartoon Room"}}}}}]);